import React from 'react'



var strength = 0;
var constitution = 0;
var dexterity = 0;
/*
const attributes = {
    strength: '20',
    constitution: '0',
    dexterity: '0'
}*/



class Hero extends React.Component {
    constructor(props) {
        super(props);
        this.setStrength = this.setStrength.bind(this);
    }

    setStrength() {
        return strength = Math.random(20);
    }

    render() {
        return (
            <div>
            <div>
                <p> Strength: {strength}</p>
            </div>
            <div>
                <button onClick={this.setStrength}>Set Strength</button>
            </div>
            </div>
        );
    }
}

export default Hero;
